San Francisco is the setting for Play-around Magazines's &quot;Most exciting sexual Experience&quot; contest. Four beautiful SMALL TOWN GIRLS, are chosen by the magazine as finalists to compete ...    Full Descriptionfor the $50,000 in prize money. Our story begins as Cindy, Barbarella, Ann and Dannielle arrive at the editor's office. Anticipation fills their minds and bodies as they learn that they have 48 hours to act out the fantasies they submitted as entries. Unbeknown to them, the magazine has assigned an &quot;able-bodied&quot; young man to take part in each adventure and so verify the stories. Which story will the editors choose for their feature article? We'll never tell.
